import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
	root: {
		display: "grid",
		gridTemplateAreas: `
		"first first2 first3 "
		"second second second"`,
		margin: theme.spacing(1),
		alignItems: "center",
		justifyItems: "center",
		border: "1px solid",
	},
	item_one: {
		border: "1px solid",
		gridArea: "first",
	},
	item_two: {
		border: "1px solid",
		gridArea: "first2",
	},
	item_three: {
		border: "1px solid",
		gridArea: "first3",
	},
	item_four: {
		border: "1px solid",
		gridArea: "second",
		width: "100%",
	},
	paper: {
		padding: theme.spacing(1),
		color: theme.palette.text.secondary,
	},
	item_first: {
		fontFamily: "Inter",
		fontStyle: "normal",
		fontWeight: 500,
		fontSize: "16px",
		lineHeight: "19px",
	},
	main: {
		fontWeight: 600,
		fontStyle: "normal",
		fontFamily: "Inter",
		fontSize: "30px",
		lineHeight: "36px",
		textAlign: "center",
	},
	item_login: {},
}));
